const express = require('express');
const axios = require('axios');
const cheerio = require('cheerio');

const app = express();
const port = 3000;

app.get('/projects', (req, res) => {
    const url = 'https://docs.atlassian.com/jira-software/REST/9.5.0/#agile/1.0/board/{boardId}/project-getProjects';
  
    axios.get(url)
      .then(response => {
        const html = response.data;
        const $ = cheerio.load(html);
        const pElements = $('p');
        console.log(pElements.text()); // Print text inside h1 elements to console
        res.send('Check console for p elements');
      })
      .catch(error => {
        console.error(error);
        res.status(500).send('Error: Could not retrieve HTML page');
      });
  });
  

app.listen(port, () => console.log(`API listening at http://localhost:${port}`));
